	}
    close = () =>{
		this.props.handleClose()
	}
    render() {
        return (
            <div className='modal'>
                <div className='container'>
                    <label>Password change</label>
                    <div>
                        <span>Old Password:</span>
                        <input type='paswword' />
                    </div>
                    <span onClick={this.close}>&#9747;</span>
                </div>
            </div>
        )
    }
}

export default index
